import React from 'react';
import { Link }  from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlayCircle } from '@fortawesome/free-solid-svg-icons';

const Track = (props) => {
    const { track } = props;
    const playmusic = <FontAwesomeIcon icon={faPlayCircle} />

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">


                    <i className="fa fa-play"></i><strong> Track: "{track}"</strong></p> 
                    <p><i className="fa fa-music"></i><strong> Artist:</strong>  {props.artist}

                    </p>

                    <img src={props.cover} width='150'></img>
                    <p></p>
                    <p><i className="fa fa-stop"></i><strong> Album:</strong> {props.album}</p>
                   <Link to={`lyrics/track/${track.key}`}
                   className="btn btn-dark btn-block"> View Lyrics</Link>
                </div>
            </div>

        </div>
    )
}
export default Track;
